import Profile from './user/User.jsx';
import Statistics from './statistics/Statistics';
import user from './user/user.json';

console.log(Profile);

export const App = () => {
  return (
    <div>
      <Profile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
    </div>
  );
};
